import React from 'react';
import '../Page.css';
import colorguessproject from '../colorguessproject.png';
// import Footer from './Footer';
// import Browse from './Browse';
// import { Link } from 'react-router-dom';

class Projects extends React.Component {
  render() {
    return (
      <div class="projects">
        <div class="projects-color"></div>
          <h1>Projects</h1>
          <div class="projects-cards">
            <div class="project">
              <img src={colorguessproject} alt="color-project" class="color-project-img" />
              <div class="project-link">
                <a href="https://github.com/fernandacajueiro/color-guess-project">
                  Check it out
                </a>
              </div>
              <div class="hide">
                An RGB color guesser
              </div>
            </div>

            <div class="project">
              PROJETO 2
            </div>

            <div class="project">
              PROJETO 3
            </div>

            <div class="project">
              PROJETO 4
            </div>
          </div>
      </div>
    )
  }
};

export default Projects;
